import fetch from 'isomorphic-unfetch';
import { Charts, ChartContainer, ChartRow, YAxis, LineChart } from "react-timeseries-charts";
import { TimeSeries, TimeRange } from "pondjs";

const Index = (props: {timeseries: TimeSeries, timerange: TimeRange}) => {
  return <div>
    <ChartContainer timeRange={props.timerange} width={800}>
      <ChartRow height="200">
      <YAxis
          id="in"
          label="in"
          min={0} max={100}
          width="60" format="$,.2f"/>
        <Charts>
          <LineChart axis="axis1" series={props.timeseries} />
        </Charts>
      </ChartRow>
    </ChartContainer>
    <p>{JSON.stringify(props.timeseries)}</p>
  </div>
}

Index.getInitialProps = async function () {
  const res = await fetch('https://raw.githubusercontent.com/nytimes/covid-19-data/master/us-counties.csv');
  // const data = await res.json();

  const text = await res.text();
  const [headings, ...data] = text.split('\n');
  const table = data.filter(e => e.includes('San Francisco')).map(e => e.split(','))


  const seriesData = {
    name: "traffic",
    columns: ["time", "in", "out"],
    points: [
      [1400425947000, 52, 41],
      [1400425948000, 18, 45],
      [1400425949000, 26, 49],
      [1400425950000, 93, 81],
      ]
  };

  const timeseries = new TimeSeries(seriesData);

  return {
    timeseries,
    timerange: timeseries.timerange(),
  };
};

export default Index;
